import React, { useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import { OrderProvider } from './contexts/OrderContext';
import { NotificationProvider } from './contexts/NotificationContext';
import { useAuth } from './contexts/AuthContext';
import LoginPage from './pages/LoginPage';
import DashboardPage from './pages/DashboardPage';
import TablesPage from './pages/TablesPage';
import MenuPage from './pages/MenuPage';
import OrderPage from './pages/OrderPage';
import KitchenPage from './pages/KitchenPage';
import SettingsPage from './pages/SettingsPage';
import Layout from './components/Layout';
import NotificationContainer from './components/NotificationContainer';
import LoadingSpinner from './components/LoadingSpinner';

function AppContent() {
  const { isAuthenticated, loading, user } = useAuth();

  useEffect(() => {
    // Register service worker for PWA functionality
    if ('serviceWorker' in navigator) {
      window.addEventListener('load', () => {
        navigator.serviceWorker.register('/sw.js')
          .then((registration) => {
            console.log('SW registered: ', registration);
          })
          .catch((registrationError) => {
            console.log('SW registration failed: ', registrationError);
          });
      });
    }

    // Handle online/offline status
    const handleOnline = () => {
      console.log('App is online');
      // Trigger sync of offline orders when coming back online
      const syncOfflineOrders = async () => {
        try {
          const offlineOrders = JSON.parse(localStorage.getItem('offline_orders') || '[]');
          for (const offlineOrder of offlineOrders) {
            if (!offlineOrder.synced) {
              // In a real app, this would sync with the backend
              console.log('Syncing offline order:', offlineOrder);
              offlineOrder.synced = true;
            }
          }
          localStorage.setItem('offline_orders', JSON.stringify(offlineOrders));
        } catch (error) {
          console.error('Failed to sync offline orders:', error);
        }
      };
      syncOfflineOrders();
    };

    const handleOffline = () => {
      console.log('App is offline');
    };

    window.addEventListener('online', handleOnline);
    window.addEventListener('offline', handleOffline);

    return () => {
      window.removeEventListener('online', handleOnline);
      window.removeEventListener('offline', handleOffline);
    };
  }, []);

  if (loading) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gray-50">
        <LoadingSpinner size="large" />
      </div>
    );
  }

  if (!isAuthenticated) {
    return (
      <Routes>
        <Route path="/login" element={<LoginPage />} />
        <Route path="*" element={<Navigate to="/login" replace />} />
      </Routes>
    );
  }

  return (
    <Layout>
      <Routes>
        <Route path="/" element={<Navigate to="/dashboard" replace />} />
        <Route path="/dashboard" element={<DashboardPage />} />
        <Route path="/tables" element={<TablesPage />} />
        <Route path="/menu" element={<MenuPage />} />
        <Route path="/order/:tableId" element={<OrderPage />} />
        <Route path="/kitchen" element={<KitchenPage />} />
        {user?.role === 'admin' && (
          <Route path="/settings" element={<SettingsPage />} />
        )}
        <Route path="/login" element={<Navigate to="/dashboard" replace />} />
        <Route path="*" element={<Navigate to="/dashboard" replace />} />
      </Routes>
    </Layout>
  );
}

function App() {
  return (
    <Router>
      <AuthProvider>
        <NotificationProvider>
          <OrderProvider>
            <div className="App">
              <AppContent />
              <NotificationContainer />
            </div>
          </OrderProvider>
        </NotificationProvider>
      </AuthProvider>
    </Router>
  );
}

export default App;
